import React from 'react';
import styled from 'styled-components';

function Footer() {
	return (
		<FooterContainer>
			<FooterRowContainer>
				<div className="nav-footerlink">
					<div className="logo-footerlink">
						<img
							src="https://image.wanted.co.kr/optimize?src=https%3A%2F%2Fstatic.wanted.co.kr%2Fimages%2Fuserweb%2Flogo_wanted_black.png&amp;w=110&amp;q=100"
							alt="wanted"
						/>
					</div>
					<div className="NavLinks_NavLinks__links__bQozT">
						<a
							href="https://www.wantedlab.com/"
							className=""
							target="_blank"
							rel="noreferrer"
						>
							기업소개
						</a>
						<a
							href="https://help.wanted.co.kr/hc/ko/articles/360035844551"
							className=""
							target="_blank"
							rel="noopener noreferrer"
						>
							이용약관
						</a>
						<a
							href="https://www.wanted.co.kr/privacy"
							className=""
							target="_blank"
							rel="noopener noreferrer"
						>
							개인정보 처리방침
						</a>
						<a
							href="https://help.wanted.co.kr/hc/ko/"
							className=""
							target="_blank"
							rel="noopener noreferrer"
						>
							고객센터
						</a>
					</div>
				</div>
			</FooterRowContainer>
		</FooterContainer>
	);
}

const FooterRowContainer = styled.div`
	width: 90%;
	max-width: 1060px;
	margin: 0 auto 18px;
	display: flex;
	.nav-footerlink {
		flex-grow: 1;
		display: flex;
		align-items: center;
		.logo-footerlink {
			margin-right: 50px;
		}
		a {
			font-size: 15px;
			color: #3a3a3a;
			font-weight: 500;
			line-height: 2.6;
			margin-right: 45px;
			white-space: nowrap;
		}
	}
`;

const FooterContainer = styled.footer`
	padding: 18px 0 65px;
	background-color: #fff;
	border-top: 1px solid #ececec;
`;

export default Footer;
